import React from "react";
import InfluencerNavbar from '../../../components/InfluencerNavbar';

const Profile = () => {
  return (
    <>
      <InfluencerNavbar />
      <div className="p-10 text-center">
        <h1 className="text-3xl font-bold text-purple-600">Your Profile</h1>
        <p className="mt-4 text-gray-600">Manage your bio, socials, and collaboration preferences.</p>
      </div>
    </>
  );
};

export default Profile;
